import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';

const HomePage = () => {
  return (
    <Router>
      <div className="homepage">
        <header>
          <h1>Welcome to Arthmate</h1>
        </header>
        <nav className="tabs">
          <Link to="/">Introduction</Link>
          <Link to="/team">Team</Link>
          <Link to="/about">What We Do</Link>
        </nav>
        <div className="content">
          <Routes>
            <Route path="/" element={<Introduction />} />
            <Route path="/team" element={<Team />} />
            <Route path="/about" element={<About />} />
          </Routes>
        </div>
      </div>
    </Router>
  );
};

const Introduction = () => {
  return (
    <div>
      <h2>Introduction</h2>
      <p>
        Insert your introductory content here from the official website of Arthmate.
      </p>
    </div>
  );
};

const Team = () => {
  return (
    <div>
      <h2>Team</h2>
      <p>
        Insert information about your team members here from the official website of Arthmate.
      </p>
    </div>
  );
};

const About = () => {
  return (
    <div>
      <h2>What We Do</h2>
      <p>
        Insert information about what your company does here from the official website of Arthmate.
      </p>
    </div>
  );
};

export default HomePage;
